import React from "react";
import human from "../../../Image/human.jpg";
import human2 from "../../../Image/human2.jpg";
import "./NavTop.css";
import List from "../List/List";

const NavTop = () => {
  return (
    <div className="navtop">
      <div className="row in-profile">
        <div className="col ">
          <img src={human} alt="" width="65" className="rounded-circle" />
          <i className="fa fa-bars icon float-right"></i>
        </div>
      </div>
      <div className="form-group has-search pt-1">
          <span className="fa fa-search form-control-feedback"></span>
          <input
            type="text"
            style={{ border: "none" }}
            className="form-control shadow-none"
            placeholder="Search Your Contact . . ."
          />
        </div>
    </div>
  );
};

export default NavTop;
